import React from 'react'
import { Form } from 'react-router-dom'

export default function Login() {
  return (
    <div>
        <center>
            <h4>Admin Login</h4>
                    <Form.Control required type="text" placeholder="User Name"/>
                    <Form.Control required type="password" placeholder="Password"/>
        </center>
    </div>
  )
}
